import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a modal by simulating a click on a product card (using a unique product title)
    // Use text selector for a product title to open the modal
    const productTitle = "Apple iPhone 15 Pro Max, 256GB, Natural Titanium";
    const productCard = await page.waitForSelector(`.product-title:text("${productTitle}")`, { timeout: 5000 });
    // Click the product card's parent to trigger the modal
    await productCard.evaluate(el => el.closest('.product-card').click());

    // Wait for the modal to appear (modal has id 'productModal' and style.display = 'block')
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    // Wait for modal content to be visible
    await page.waitForSelector('.modal-content', { state: 'visible', timeout: 5000 });

    // Take screenshot of modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden (display: none)
    await page.waitForSelector('#productModal', { state: 'hidden', timeout: 5000 });

    // Take screenshot after closing modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract data to verify modal is closed
    const modalVisible = await page.$eval('#productModal', el => {
      return window.getComputedStyle(el).display !== 'none';
    });

    return {
      success: !modalVisible,
      action: "Opened product modal and closed it using Escape key",
      extractedData: {
        modalVisibleAfterEscape: modalVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
